insert into terms_and_conditions(terms_id, terms_and_conditions , admin_id) values (1 , 'These terms and conditions create a contract between you and Auction (the “Agreement”). Please read the Agreement carefully.' ,1);
insert into terms_and_conditions(terms_id, terms_and_conditions , admin_id) values (2 , 'A. INTRODUCTION TO OUR SERVICES This Agreement governs your use of Auction System Services (“Services” – e.g., and where available, Live Auction, Schedule Auction, Instant Sale), through which you can buy, upload. Content may be offered through the Services by Auction or a third party. Our Services are available for your use in your country or territory of residence (“Home Country”). By creating an account for use of the Services in a particular country or territory you are specifying it as your Home Country. To use our Services, you need compatible hardware, software (latest version recommended and sometimes required) and Internet access (fees may apply). Our Services’ performance may be affected by these factors.' ,1);
insert into terms_and_conditions(terms_id, terms_and_conditions , admin_id) values (3 , 'B. USING OUR SERVICES PAYMENTS, TAXES, AND REFUNDS You can acquire Content on our Services for free or for a charge, either of which is referred to as a “Transaction.” Each Transaction is an electronic contract between you and Auction System, and/or you and the entity providing the Content on our Services. However, if you are a customer of Our Services., Auction. is the merchant of record for some Content you acquire from Live/Schedule Auction, Instant Sales or as displayed on the product page and/or during the acquisition process for the relevant Service. When you make your first Login, we will ask you to choose Preferred Category for future Homepage' ,1);
insert into terms_and_conditions(terms_id, terms_and_conditions , admin_id) values (4 , 'Auction System will charge your selected payment method for any paid Transactions, including any applicable taxes.' ,1);
insert into terms_and_conditions(terms_id, terms_and_conditions , admin_id) values (5 , 'If User upload product admin must approve it first before publishing it-	User pays amount for uploading product and must send Proof of payment of this product to admin to accept it (Auction Product Only)-	User that wants to buy and enter any Auction must pay deposit of Auction Starting Price to ensure that no spam their must send Proof of payment of this product to admin to accept it and start bidding.-	If you won an (Auction) we recommend you meet with the owner in public place in front of people, The company disclaims its responsibility for being in unknown places-	If you want to buy any product using (Instant Sale) we recommend you meet with the owner in public place in front of people, The company disclaims its responsibility for being in unknown places' ,1);
